const MpSummaryItemData = [
    {
        num: "01",
        name: "SKILLS",
        item: [
            'HTML, CSS, SASS(SCSS), javascript',
            'photoshop, illustrator',
            'git, gulp, etc'
        ]
    },
    {
        num: "02",
        name: "EXPERIENCE",
        item: [
            '휴머스온 (퍼블리셔 @TasOn 운영팀)',
            '교보문고 (퍼블리셔 @CX 혁신팀)',
            '티몬 (마크업 개발자 @마크업개발팀)',
            '엑스이허브 (퍼블리셔 @UI 개발팀)',
            '개인사업자 (디자이너 & 퍼블리셔)'
        ]
    },
    {
        num: "03",
        name: "LICENSE",
        item: [
            'GTQ 1급',
            '컴퓨터그래픽스기능사',
            '웹디자인기능사'
        ]
    },
    {
        num: "04",
        name: "EDUCATION",
        item: [
            '패스트 캠퍼스 (Web 개발 취업 스쿨 1학기)',
            '하이미디어 아카데미 (웹퍼블리셔반)',
            '가천대학교 (시각디자인과)'
        ]
    }
]

export default MpSummaryItemData;
